import React from 'react';
import Carousel  from 'react-elastic-carousel';

export const SimpleCarousel = () => (
    <Carousel itemPadding={[10, 50]} itemsToShow={3}>
        <Item>1</Item>
        <Item>2</Item>
        <Item>3</Item>
        <Item>4</Item>
        <Item>5</Item>
        <Item>6</Item>
    </Carousel>
)
